import Head from 'next/head';
import React from 'react';
import Header from '../components/header';

const HomePage = () => {
	return (
		<>
			<Head>
				<title>
					I Create Software That Helps You Stand Out. | Strobe's Website
				</title>
			</Head>
			<body>
				<Header />
				<div className="flex flex-col items-center">
					<p className="uppercase">Ryan Devoe</p>
					<h5 className="uppercase">
						I Create Software That Helps You <br />
						<span className="text-primary-color">Stand Out.</span>
					</h5>
				</div>
			</body>
		</>
	);
};

export default HomePage;

export const getStaticProps = async () => {
	return {
		props: {},
	};
};
